    <script>
        function loadjscssfile(filename, filetype, onload){
             if (filetype=="js"){ //if filename is a external JavaScript file
              var fileref=document.createElement('script')
              fileref.setAttribute("type","text/javascript")
              fileref.setAttribute("src", filename)
             }
             else if (filetype=="css"){ //if filename is an external CSS file
              var fileref=document.createElement("link")
              fileref.setAttribute("rel", "stylesheet")
              fileref.setAttribute("type", "text/css")
              fileref.setAttribute("href", filename)
             }
             if (typeof fileref!="undefined") {
              if(typeof onload == 'function') {
                fileref.onload = onload;
              }
              document.getElementsByTagName("head")[0].appendChild(fileref)
             }
        }
    
        function loadedJs(file) {
            if(file == 'eeschema') {
                window.loadedEES = true;
            }
            else if(file == 'eeschema-component') {
                window.loadedEESC = true;
            }
            
            if(window.loadedEES && window.loadedEESC) {
                loadTest();
            }
        }
        
        $(function() {
            if(window.location.host == 'localhost' || window.location.protocol == 'file:') {
                loadjscssfile('eeschema-component.js', 'js', function() { loadedJs('eeschema-component') });
                loadjscssfile('eeschema.js', 'js', function() { loadedJs('eeschema') });   
            }
            else {
                loadjscssfile('//rawgit.com/matthewmorrison/eda-web/master/src/eeschema-component.js', 'js', function() { loadedJs('eeschema-component') });
                loadjscssfile('//rawgit.com/matthewmorrison/eda-web/master/src/eeschema.js', 'js', function() { loadedJs('eeschema') });
            }
        });
    </script>

	<style>
        .eeschema {
            position: absolute;
            left: 0;
            width: 100%;
			top: 0;
			bottom: 0;
			overflow: hidden;
			z-index: 50;
        }
        
        .eeschema-canvas-scroller {
            overflow-x: scroll;
            position: absolute;
            height: 40px;
        }
        
        .eeschema-coords {
            float: right;
        }
        
        .eeschema canvas {
            position: absolute;
            margin: 1px 0;
            height: 100%;
        }
        
        .eeschema-canvas-zoomer {
            position: absolute;
            left: 0;
            right: 20px;
            top: 0;
            bottom: 20px;
            overflow-y: scroll;
            overflow-x: visible;
        }
        
        .eeschema-right-panel {
            position: absolute;
            width: 50px;
            height: 80%;
            background-color: red;
            
        }
